let startBtn = parcel.getFeatureById('startbtn')
let strsym = parcel.getFeatureById('start-symbol')
let kartsng = parcel.getFeatureById('photovoltaic-car')
let kartff = parcel.getFeatureById('ff-cart')
let volgrp = parcel.getFeatureById('cart-grp')
let kartffgrp = parcel.getFeatureById('ffkrt-grp')
let kartfffwdMove = kartffgrp.createAnimation('position')
let photofwdMove = volgrp.createAnimation('position')
let startPos, startFoss, waiting_kg, mvffPos = 6
let mvphotoPos = 8
let counterPlay, intervalldPlay, winSign = parcel.getFeatureById('win-grp');

waitForDone_kg = (n, s) => {return new Promise(resolve => {setTimeout(() => {resolve(n)}, s);}).catch(e => console.error(e.message));};

startTimerbegin = () => {
   console.log('starting beginning timer!');
   let counter = 0;
   const intervalId = setInterval(() => {
      counter += 1;
      if (counter === 1) {
         console.log('beginning timer has finished!');
         clearInterval(intervalId);
         mvphotoFwdOne();    
         mvffFwdOne();      
      }
   }, 1000);
};

mvffFwdOne = async () => {
  try {
  let waitMv_kg = waitForDone_kg(waiting_kg=true, 150);
  await waitMv_kg;}
  catch (error) {console.error(error);}
  kartfffwdMove.setKeys([{
      frame: 10,
      value: kartffgrp.position.add(new Vector3(0,0,mvffPos))
    }]);
  kartffgrp.startAnimations( [kartfffwdMove]);
  kartffgrp.position.z += mvffPos;
};

mvphotoFwdOne = async () => {
  try {
  let waitMv_kg = waitForDone_kg(waiting_kg=true, 150);
  await waitMv_kg;}
  catch (error) {console.error(error);}
  photofwdMove.setKeys([{
      frame: 10,
      value: volgrp.position.add(new Vector3(0,0,mvphotoPos))
    }]);
  volgrp.startAnimations( [photofwdMove]);
  volgrp.position.z += mvphotoPos;
  winPop();
};

winPop = async () => {
  try {
  let waitMv_kg = waitForDone_kg(waiting_kg=true, 750);
  await waitMv_kg;}
  catch (error) {console.error(error);}
  winSign.position.y = 1.36;
}

startBtn.on('click', async e => {
    strsym.set({playertimerStarted: true});
    startPos = volgrp.position.x;
    startFoss = kartffgrp.position.x;
    if (startPos === -0.17 && startFoss === -2.45) {
         strsym.set({startingPosition: startPos});  
         startTimerbegin();
    } 

  window = this
  importScripts( 'https://cdn.jsdelivr.net/npm/gun/gun.js', 'https://cdn.jsdelivr.net/npm/gun/lib/then.js', "https://cdn.jsdelivr.net/npm/gun/lib/radix.js", "https://cdn.jsdelivr.net/npm/gun/lib/radisk.js", "https://cdn.jsdelivr.net/npm/gun/lib/store.js", "https://cdn.jsdelivr.net/npm/gun/lib/rindexed.js" )

  let gun = Gun({ localStorage: false, radisk: true })

  const game = gun.get('chronos_minigame')  
  game.put({ spring: true })

  const gameData = await gun.get('chronos_minigame');
	console.log('gameData', gameData, await gun.get('chronos_minigame') )

});

